import React, { Component } from 'react'
import TodoItem from './TodoItem'

class ToDo extends Component {


    render() {
        console.log(this.state.todos)
        return  this.state.todos.map((todo) => {
                    <TodoItem todo = {todo}/> }
        )

    }
}

export default ToDo
